Ext.data.JsonP['Studio_3.4.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Studio 3.4.1 - 14 November 2014</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-46244834\" class=\"content\">\n                        <h1>Studio 3.4.1 - 14 November 2014</h1>\n    <div class=\"section section-2 \" id=\"src-46244834_Studio3.4.1ReleaseNote-BugFixes\">\n        <h2 class=\"heading \"><span>Bug Fixes</span></h2>\n<ul class=\" \"><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7032\" target=\"_blank\">TISTUD-7032</a>: The default size of modules table in tiapp.xml editor is reduced    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7018\" target=\"_blank\">TISTUD-7018</a>: Yosemite: Node.ACS update is not listed in Studio update wizard    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7015\" target=\"_blank\">TISTUD-7015</a>: Studio creates android L x86_64 bit emulator rather than an arm emulator by default if no emulator exists    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-6940\" target=\"_blank\">TISTUD-6940</a>: Content Assist not showing many of the methods and properties of objects    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-6681\" target=\"_blank\">TISTUD-6681</a>: Android is not detected on Studio Dashboard if only Android L (5.0) is installed    </p>\n</li><li class=\"p1 \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-1335\" target=\"_blank\">TISTUD-1335</a>: Content Assist: JavaScript class objects generate non-static proposals    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46244834\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Studio 3.4.1 Release Note"});